let data = msg.payload;
let MainOrder = global.get('MainOrder') || [];
let output = Array(20).fill("");

let Input = flow.get('Input');
let nawa = flow.get('nawa');

if (!isNaN(nawa) && nawa < MainOrder.length) {
    let currentData = MainOrder[nawa];
    let output1 = parseFloat(currentData.Mat_Quantity) - parseFloat(currentData.Mat_Sep) + parseFloat(currentData.Mat_Actual_Weight) + parseFloat(data);
    let output2 = parseFloat(currentData.Mat_Quantity) + parseFloat(data);
    let percenterror = ((output1 - parseFloat(currentData.Mat_Quantity)) / parseFloat(currentData.Mat_Quantity)) * 100;
    let percenterror2 = ((output2 - parseFloat(currentData.Mat_Quantity)) / parseFloat(currentData.Mat_Quantity)) * 100;
    let Mat_CP = currentData.Mat_CP;
    let Mat_Name = currentData.Mat_Name;
    let outputT = output1.toFixed(2);
    let Add = flow.get('Add'+nawa.toString());

    for (let i = 0; i < MainOrder.length; i++) {
        if (i === nawa) {
            if (['Finish', 'Bypass'].includes(MainOrder[i].Mat_Status)) {
                if (Add == 1) {
                    output[i] = [Mat_CP, Mat_Name, output1.toFixed(3)];
                    global.set("Mat_SUM" + nawa.toString(), output1.toString());
                    global.set("PercentError" + nawa.toString(), percenterror.toFixed(2));
                    global.set("Mat_SET" + nawa.toString(), data);
                    }
            }
            else if (['All_Full'].includes(MainOrder[i].Mat_Status)) {
                if (Add == 1){
                    output[i] = [Mat_CP, Mat_Name, output2.toFixed(3)];
                    global.set("Mat_SUM" + nawa.toString(), output2.toString());
                    global.set("PercentError" + nawa.toString(), percenterror2.toFixed(2));
                    global.set("Mat_SET" + nawa.toString(), data);
                }
            } else {
                output[i] = '';
                global.set("Mat_SUM" + nawa.toString(), );
                global.set("PercentError" + nawa.toString(), );
                global.set("Mat_SET" + nawa.toString(), );
            }
        } else {
            output[i] = '';
        }
    }
}

msg.payload = output;
flow.set('Input', '');
flow.set('nawa', '');
return msg;

